import React from 'react';
import Card from '../components/Card';

class Portfolio extends React.Component {
    constructor() {
        super();
        this.projects = {
            'Avatar': {
                title: 'Avatar the Last Airbender Guessing Game'
                , description: "An Avatar-themed phrase guessing game (it's my favorite show). Its Javascript code includes event listeners that produce a game very similar to a regular game of Hangman."
                , img: {
                    src: require('../content/images/avatar.png'),
                    alt: 'Avatar: The Last Airbender Title Screen'
                }
                , links: [
                    {
                        href: 'https://woolleygrammoth.github.io/td-project-6/', 
                        text: 'See this project'
                    }, 
                    {
                        href: 'https://github.com/woolleygrammoth/td-project-6',
                        text: 'Source code'
                    }
                ]
                , skills: [
                    'Javascript',
                    'JS DOM Manipulation',
                    'JS Event Listeners'
                ]
            }, 
            'Photo Gallery': {
                title: 'Interactive Photo Gallery'
                , description: "A photo gallery which I built using CSS Grid, a Javascript lightbox plugin, and original search filter functionality. You can filter the photos based on their captions in the lightbox. Enjoy these pictures of my dog and family!"
                , img: {
                    src: require('../content/images/bayviewcafe.jpg'),
                    alt: 'San Francisco Bay as seen from the Lawrence Hall of Science'
                }
                , links: [
                    {
                        href: 'https://woolleygrammoth.github.io/td-project-5/', 
                        text: 'See this project'
                    }, 
                    {
                        href: 'https://github.com/woolleygrammoth/td-project-5',
                        text: 'Source code'
                    }
                ]
                , skills: [
                    'Javascript',
                    'CSS Grid',
                    'JS DOM Manipulation'
                ]
            }, 
            'Webapp Dashboard': {
                title: 'Webapp Dashboard'
                , description: "A dashboard for a hypothetical website or application. I built it from scratch using HTML, styled it in CSS, and added interactions in Javascript. I used Chart.js to display hypothetical web traffic data, animated SVG icons, and used localStorage to save a user's settings."
                , img: {
                    src: require('../content/images/dashboard.png'),
                    alt: 'Nondescript bar graph'
                }
                , links: [
                    {
                        href: 'https://woolleygrammoth.github.io/td-project-7/', 
                        text: 'See this project'
                    }, 
                    {
                        href: 'https://github.com/woolleygrammoth/td-project-7',
                        text: 'Source code'
                    }
                ]
                , skills: [
                    'Javascript',
                    'Chart.js', 
                    'CSS Grid',
                    'CSS Flexbox', 
                    'JS DOM Manipulation',
                    'HTML', 
                    'SVG', 
                    'JS localStorage'
                ]
            }, 
            'Employee Directory': {
                title: 'Employee Directory using Fetch'
                , description: "Each time the page loads, random user data is fetched from the randomuser.me API to construct a mock employee directory. I used Fetch to obtain the data and CSS Grid to display it nicely. I used Javascript to add a search filter as well as a pop-up window that displays more detailed information about each employee."
                , img: {
                    src: require('../content/images/directory.png'),
                    alt: 'Binary Tree'
                }
                , links: [
                    {
                        href: 'https://woolleygrammoth.github.io/td-project-8/', 
                        text: 'See this project'
                    }, 
                    {
                        href: 'https://github.com/woolleygrammoth/td-project-8',
                        text: 'Source code'
                    }
                ]
                , skills: [
                    'Javascript', 
                    'Javascript Fetch API', 
                    'CSS Grid', 
                    'HTML', 
                    'CSS Flexbox',
                    'JS DOM Manipulation'
                ]
            }, 


        }
    }

    render() {
        return (
            <main className='main-portfolio'>
                <Card {...this.projects['Avatar']}/>
                <Card {...this.projects['Photo Gallery']}/>
                <Card {...this.projects['Webapp Dashboard']}/>




            </main>
        );
    }
}


export default Portfolio;
